class _1930UniqueLength3PalindromicSubsequences {
    public int countPalindromicSubsequence(String s) {
        

        int[] carr = new int[26];

        for(int i=0; i< s.length(); ++i){
            ++carr[s.charAt(i) - 97];
        }
        
        int ans = 0;

        for(int i = 0; i < 26; ++i){
            if(carr[i] >= 2){
                int l = 0;
                for(int j = l; l <s.length(); ++l){
                    if(s.charAt(l) == (i + 97))
                        break;
                }

                int r = s.length() - 1;

                for(int j =  r; r >= 0; --r){
                    if(s.charAt(r) == (i + 97))
                        break;
                }

                if(r - l < 2){
                    continue;
                }

                int[] carrtemp = new int[26];

                for(int j=l+1; j< r; ++j){
                    ++carrtemp[s.charAt(j) - 97];
                }
                
                for(int n: carrtemp){
                    if(n != 0){
                        ++ans;
                    }
                }

            }
        }

        return ans;
    }   


    public static void main(String[] args) {
        _1930UniqueLength3PalindromicSubsequences ob = new _1930UniqueLength3PalindromicSubsequences();
        System.out.println(ob.countPalindromicSubsequence("bbcbaba"));
        System.out.println(ob.countPalindromicSubsequence("aabcaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"));
        System.out.println(ob.countPalindromicSubsequence("wmqoidgsktvlalvudugusqsgefqnumbjurigjxoztelqgsmsxchsvjyjsgxeqdhawcgnbtgvvacvdvdjimakknzqjlwghhtlgrrr"));
        //System.out.println(ob.countPalindromicSubsequence(""));

    }
}
